import React from "react";
import MessageIsEmpty from "../../components/MessageIsEmpty";
import imageNotFound from '../../images/icons8-error-100.png';

function NotFound() {
	return (
		<div className='container-main-page-not-found'>
			<div className='container-image-page-not-found w-full'>
				<img src={imageNotFound} alt="Imagem NotFound" />
			</div>
			<div className='container-text-page-not-found'>
				<p className="w-full text-center text-black font-bold text-xl">
					A rota que você tentou acessar não existe!
				</p>
			</div>
			<div className='container-buttom-page-not-found'>

			</div>
		</div>
	);
}
export default NotFound;
